import VueRouter from "vue-router";
import LoginPage from '@/components/LoginPage'
import Home from '@/components/Home'
import Vue from 'vue'
Vue.use(VueRouter)

const router = new VueRouter({
    router : [
        {
            path:'/',
            component: LoginPage,
        },
        {
            path:'/home',
            component:Home
        }
    ]
})

export default router;
